import React from "react"

const Social = props => {
  const { socialLink, socialIcon } = props

  return (
    <li className="social-list__item">
      <a
        clasName="social-list__link"
        href={socialLink}
        target="_blank"
        rel="noreferrer">
        <i class="fa-brands ${socialIcon}" />
      </a>
    </li>
  )
}
export default Social
